import React, { Component } from 'react';
import '../App.css';

export default class News extends Component {
    render() {
        console.log(this.props);
        return(
            <div className="News">
                <img src={this.props.newImg} alt="z"></img>
                <div className="news-info flex-center">
                    <div className="news-small">{this.props.newTime}</div>
                    <div className="news-small">{this.props.newCate}</div>
                </div>
                <div className="news-title-box">
                    {this.props.newTitle}
                </div>
                <div className="news-content">
                    {this.props.newContent}
                </div>
            </div>
        )
    }
}
